                      {/* <span  class="ei3_6899_1_1035_1_1021">Text</span> */}
                      {(emailDirty && passwordDirty) && <div style={{color:"#FF0000"}}>{emailError}</div>}
                      <input onChange={(e)=>emailHandler(e)} value={email} onBlur={(e)=>blurHandler(e)} name='email' type="text"/>
                    </div>
                  </div>
                </div>
                <div class='e3_6917'>
